import React, { Component } from 'react'
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import SidePannel from './SidePannel';
import Navbar from 'react-bootstrap/Navbar';
export class Header extends Component {
    render() {
        return (
            <div>
            <nav class="navbar navbar-light fixed-top navbar-expand-sm ">
        <Container>
        <Navbar.Toggle aria-controls="Navbr"/>
            <a href="#" class="navbar-brand "><img src="img/logo.jpeg" height="30" width="31"/></a>
            <Navbar.Collapse  id="Navbr">
                <ul class="navbar-nav ml-auto">     
                    <li class="nav-item"><a class="nav-link active" href="#"><span class="fa fa-home fa-lg"></span> Dashboard</a></li>
                    <li class="nav-item"><a class="nav-link" href="#services"><span class="fa fa-wrench fa-lg"></span> Notifications</a></li>
                    <li class="nav-item"><a class="nav-link" href="#about"><span class="fa fa-info fa-lg"></span> Profile</a></li>
                    <li class="nav-item"><a class="nav-link " href="#contact"><span class="fa fa-address-card fa-lg"></span> Settings</a></li>
                </ul>
            </Navbar.Collapse >
        </Container>
    </nav>
</div>



        )
    }
}

export default Header
